import Dashboardside from './Dashboardside'
import {Row, Col} from 'reactstrap';
const  Dashboard = () => {
    return (
        <div>
            <div className="row">
               <div className="col right col-md-3 col-sm-7" >
                   
               </div>
            <Dashboardside/>
            <h2>Hello guys</h2>
            </div>
           
        </div>
    )
}
export default Dashboard;
